FeedPackage.ReleaseNotes:
* fixed the wrong log4net version in the NuGet reference;
* added the higher version TLS support;
* added the configuration hot update;
* improved the server instances stopping order (descending by StartupOrder);
* support local endpoint designate binding for active connect socket;
* allowed socket address reuse for active connect socket;
* improved the process isolation mode to support read configuration the other sections like appSettings, connectionStrings and so on;
* fixed one unhandled exception of performance counter which may occur when stop the bootstrap;
* fixed one IndexOfRange exception about sending queue;
* made some improvements for the ServerManager;

!! The changes are included in this release:

* fixed an unhandled exception caused by performance counter when stop instances;
* fixed wrong close reason code when the client close the connection gracefully;
* fixed a serious bug about the SAE object is not released after the session is closed;
* fixed the serialization issue about hot configuration updating in isolation mode;
* exposed the api about setting max request length in code;
* added a configuration option for the working process startup timeout (in Process isolation model);
* added the configuration option autoStartAfterUnexpectedShutdown to control whether auto start the working process if it crash unexpected (in Process isolation model);

* 修复了停止实例时性能计数器导致的未捕获异常;
* 修复了当客户端正常关闭连接时错误的CloseReason返回值;
* 修复了一个关于SAE对象在连接关闭后没有正常释放的严重缺陷;
* 修复了以个在隔离模式下热配置更新导致的序列化异常;
* 新增了在代码中设置最大请求长度的API;
* 增加了工作进程启动超时的配置选项 (进程级别隔离模式);
* 增加了配置项 autoStartAfterUnexpectedShutdown 用以控制在工作进程意外关闭时是否重启进程 (进程级别隔离模式);

1) fixed assembly signing issue;
2) made the pipeline processor can be reusable;
3) fixed the bug offset was not used for sending;
4) fixed the compiling error in Xamarin.IOS;
5) catch the exception about the NoDelay accessing;

